svg.script:


function onMouseOverLabel_sselect(evt) { 
    var Line_sselect = document.getElementById(evt.target.id.replace("Label_sselect", "Line_sselect")); 
    Line_sselect.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    evt.target.setAttribute("font-size", 17); 
} 
function onMouseOutLabel_sselect(evt) { 
    var Line_sselect = document.getElementById(evt.target.id.replace("Label_sselect", "Line_sselect")); 
    Line_sselect.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    evt.target.setAttribute("font-size", 15); 
} 
function onMouseOverLine_sselect(evt) { 
    var Label_sselect = document.getElementById(evt.target.id.replace("Line_sselect", "Label_sselect")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    Label_sselect.setAttribute("font-size", 17); 
} 
function onMouseOutLine_sselect(evt) { 
    var Label_sselect = document.getElementById(evt.target.id.replace("Line_sselect", "Label_sselect")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    Label_sselect.setAttribute("font-size", 15); 
}
